<style  type="text/css">

div#unlock_board {

	animation-timing-function: linear;

<script type="text/javascript"><!--
var input_execute_button = null;
var timer_of_button = null;

function set_button() {
	input_execute_button = document.getElementById("input_execute");
	if (input_execute_button) {
		input_execute_button.addEventListener("keydown", (event) => {
			if (event.key == "Enter") {
				if (timer_of_button) {
					clearTimeout(timer_of_button);
				}
				event.target.classList.add("active");
				timer_of_button = setTimeout(function() {
					event.target.classList.remove("active");
					timer_of_button = null;
				}, 150);
			}
		});
		input_execute_button.addEventListener("mousedown", (event) => {
			event.target.classList.add("active");
		});
		input_execute_button.addEventListener("mouseup", (event) => {
			event.target.classList.remove("active");
		});
		input_execute_button.addEventListener("mouseleave", (event) => {
			event.target.classList.remove("active");
		});
	}
}

function display_body() {
	let return_flag = false;
	let body_object = document.getElementById("unlock_body");
	if (body_object) {
		body_object.style.display = "block";
		return_flag = true;
	} else {
		console.log("Failed to 'display_body();'.");
	}
}

function auto_decrypt() {
	/* 自動復号化モードの確認 */
	let auto_decrypt_mode_object = document.getElementById("auto_decrypt_mode_box");
	let auto_decrypt_mode = false;
	if (auto_decrypt_mode_object && Number(auto_decrypt_mode_object.value) > 0) {
		auto_decrypt_mode = true;
	}
	if (auto_decrypt_mode) {
		let url = new URL(window.location.href);
		let params = url.searchParams;
		/* パラメータに'sdp_clear'があった場合はセッションストレージを消去 */
		if (params.has("sdp_clear") && Number(params.get("sdp_clear")) > 0) {
			delete_session_storage();
		}
		/* パラメータに'sdp_password'があった場合はそれをパスワード入力とみなす */
		if (params.has("sdp_password")) {
			try {
				let parameter_password = params.get("sdp_password");
				console.log(parameter_password);
				if (parameter_password) {
					execute_decrypt(parameter_password); /* 成功時のデータを借用 */
				} else {
					display_body();
					/*console.log("point A2");*/
				}
			} catch(error) {
				display_body();
				/*console.log("point A3");*/
				throw error;
			}
		} else {
			/* セッションストレージから成功時のパスワードを抜き出し */
			load_session_storage()
			.then(function(val) {
				if (val) {
					try {
						execute_decrypt(val); /* 成功時のデータを借用 */
					} catch(error) {
						display_body();
						/*console.log("point B2");*/
						throw error;
					}
				} else {
					display_body();
					/*console.log("point B3");*/
				}
			})
			.catch(function (error) {
				console.log("ERROR", error.name, error.message);
				throw error;
			});
		}
	} else {
		display_body();
		/*console.log("point C1");*/
	}
}

function focus_input_for_password() {
	setTimeout(function() {
		let password_object = document.getElementById("input_password");
		if (password_object) {
			password_object.focus();
		} else {
			console.log("Failed to 'focus_input_for_password();'.");
		}
	}, 1);
}

/* ロード時にボタンクリック時の挙動を定義する */
window.addEventListener("load", function() {
	console.log("STEP", "load");
	auto_decrypt(); 
	set_button();
	focus_input_for_password();
});

/*組みあがった際に実行 DOMContentLoaded */
document.addEventListener("DOMContentLoaded",function() {
	console.log("STEP", "DOMContentLoaded");
});

/* セッションストレージの読み書き */
function save_session_storage_core(data, special_code) {
	let special_code_buffer = "";
	if (special_code) {
		special_code_buffer = "-" + special_code;
	}
	if (data) {
		console.log("SAVE (SessionStorage):", "password" + special_code_buffer);
		sessionStorage.setItem("password" + special_code_buffer, data);
	}
}
function load_session_storage_core() {
	let special_code_object = document.getElementById("special_code_box");
	let special_code = "";
	if (special_code_object) {
		special_code = "-" + special_code_object.value;
	} else {
		console.log("Not found 'special_code_box'.")
	}
	console.log("LOAD (SessionStorage):", "password" + special_code);
	return sessionStorage.getItem("password" + special_code);
}
function delete_session_storage() {
	let special_code_object = document.getElementById("special_code_box");
	let special_code = "";
	if (special_code_object) {
		special_code = "-" + special_code_object.value;
	}
	console.log("DELETE (SessionStorage):", "password" + special_code);
	sessionStorage.removeItem("password" + special_code);
}

/* セッションストレージ関連のデータ保護 */
function save_session_storage(data) {
	/* データ取得 */
	let special_code_object = document.getElementById("special_code_box");
	let sub_password_object = document.getElementById("sub_password_box");
	let sub_iv_object = document.getElementById("sub_initialization_vector_box");
	let sub_salt_object = document.getElementById("sub_salt_box");
	/* データ加工 */
	let special_code = special_code_object.value;
	let sub_password = b642ab(sub_password_object.value);
	let sub_iv = b642ab(sub_iv_object.value);
	let sub_salt = b642ab(sub_salt_object.value);
	encrypt(str2ab(data), sub_password, sub_salt, sub_iv)
	.then(function (val) {
		save_session_storage_core(reverse_b642ab(val), special_code);
	})
	.catch(function (error) {
		/*console.error(error);*/
		throw error;
	});
}
async function load_session_storage() {
	let return_data = null;
	let buffer = load_session_storage_core();
	if (buffer) {
		/* データ取得 */
		let sub_password_object = document.getElementById("sub_password_box");
		let sub_iv_object = document.getElementById("sub_initialization_vector_box");
		let sub_salt_object = document.getElementById("sub_salt_box");
		/* データ加工 */
		let sub_password = b642ab(sub_password_object.value);
		let sub_iv = b642ab(sub_iv_object.value);
		let sub_salt = b642ab(sub_salt_object.value);
		return_data = await decrypt(b642ab(buffer), sub_password, sub_salt, sub_iv);
	}
	return return_data;
}

async function generateAesKeyFromPassword(password, salt, iterations, keyLength) {
	try {
		const encodedPassword = new TextEncoder().encode(password);
		const cryptoKey = await crypto.subtle.importKey(
			"raw",
			encodedPassword,
			{
				name: "PBKDF2"
			},
			false,
			["deriveBits"]
		);
		const derivedBits = await crypto.subtle.deriveBits(
	  		{
				name: "PBKDF2",
				salt: salt,
				iterations: iterations,
				hash: "SHA-256",
	 		 },
			cryptoKey,
			keyLength * 8
		);
		const derivedKey = new Uint8Array(derivedBits);
		return derivedKey;
	} catch (error) {
		console.error("Error generating key:", error);
		throw error;
	}
}

var importKey = function(password) {
    return window.crypto.subtle.importKey(
        "raw",
        str2bytes(password),
        {
            name: "PBKDF2",
        },
        false,
        ["deriveBits"]
    );
};
var getHashOutputLength = function(hashAlgorithm) {
    switch (hashAlgorithm) {
    case "SHA-1":   return 160;
    case "SHA-256": return 256;
    case "SHA-384": return 384;
    case "SHA-512": return 512;
    default:
        break;
    }
    throw new Error("Unsupported hash algorithm");
};
var deriveBits = function(key, salt, hashAlgorithm, iterations) {
    hashAlgorithm = hashAlgorithm || "SHA-256";
    return window.crypto.subtle.deriveBits(
        {
            name: "PBKDF2",
            salt: salt,
            iterations: iterations || 1000,
            hash: {name: hashAlgorithm}, //"SHA-1", "SHA-256", "SHA-384", or "SHA-512"
        },
        key,
        getHashOutputLength(hashAlgorithm)
    );
};

/* パスワードハッシュ化 */
var hashpw = function(password, salt) {
    return importKey(password).then(function(key) {
        return deriveBits(key, salt, "SHA-256", 1000);
    }).then(function(buffer) {
        var bytes = new Uint8Array(buffer);
        return bytes2base64(bytes);
    });
};
--></script><script type="text/javascript"><!--
function str2ab(str) {
	const buf = new ArrayBuffer(str.length);
	const bufView = new Uint8Array(buf);
	for (let i = 0, strLen = str.length; i < strLen; i++) {
		bufView[i] = str.charCodeAt(i);
	}
	return buf;
}

function reverse_b642ab(binary_code) {
	let binaryString = "";
	const bytes = new Uint8Array(binary_code);
	const len = bytes.byteLength;
	for (let i = 0; i < len; i++) {
		binaryString += String.fromCharCode(bytes[i]);
	}
	return btoa(binaryString);
}

function b642ab(base64) {
	let binary_string = window.atob(base64);
	let len = binary_string.length;
	let bytes = new Uint8Array(len);
	for (var i = 0; i < len; i++) {
		bytes[i] = binary_string.charCodeAt(i);
	}
	return bytes.buffer;
}

async function encrypt(plain, password, salt, iv) {
	let key_sorce = await generateAesKeyFromPassword(password, salt, 100000, 32);
	let key = await crypto.subtle.importKey(
		"raw",
		key_sorce,
		"AES-CBC",
		true,
		["encrypt"]
	);
	let buffer = await window.crypto.subtle.encrypt(
  		{
			name: "AES-CBC",
			iv: iv
		},
		key,
		plain
	);
	return buffer;
}

async function decrypt(cipher, password, salt, iv) {
	let key_sorce = await generateAesKeyFromPassword(password, salt, 100000, 32);
	let key = await crypto.subtle.importKey(
		"raw",
		key_sorce,
		"AES-CBC",
		true,
		["decrypt"]
	);
	let buffer = await window.crypto.subtle.decrypt(
  		{
			name: "AES-CBC",
			iv: iv
		},
		key,
		cipher
	);
	return new TextDecoder().decode(buffer);
}

function escape_html(string) {
	if(typeof string !== "string") {
		return string;
	}
	return string.replace(/[&'`"<>]/g, function(match) {
		return {
			"&"  : "&amp;",
			"'"  : "&#x27;",
			"`"  : "&#x60;",
			"\"": "&quot;",
			"<"  : "&lt;",
			">"  : "&gt;",
		}[match]
	});
}

var hide_timer = null;

async function execute_decrypt(input_password) {
	/* パスワード関連 */
	let password = null;
	let password_object = document.getElementById("input_password");
	if (input_password) {
		password = input_password;
	} else {
		password = password_object.value;
	}
	/* データ取得 */
	let crypted_data_object = document.getElementById("crypted_data_box");
	let iv_object = document.getElementById("initialization_vector_box");
	let salt_object = document.getElementById("salt_box");
	/* データ加工 */
	let crypted_data = b642ab(crypted_data_object.value);
	let iv = b642ab(iv_object.value);
	let salt = b642ab(salt_object.value);
	/* テスト */
	console.log("DECRYPT", "password:", password, "iv:", iv, "salt:", salt);
	/* 参照 */
	let rooting_space = document.getElementById("rooting_box_s");
	let warning_space_pw = document.getElementById("warning_box_pwe");
	let warning_space_u = document.getElementById("warning_box_ue");
	let warning_space_e = document.getElementById("warning_box_ee");
	/* 分岐 */
	if (hide_timer) {
		clearTimeout(hide_timer);
	}
	if (password && password.length > 0) {
		/* 復号化 */
		decrypt(crypted_data, password, salt, iv)
		.then(function (val) {
	    	console.log("OK", val.length);
	    	if (rooting_space) {
	    		rooting_space.classList.remove("active_animation");
				rooting_space.classList.add("active");
				setTimeout(function() { rooting_space.classList.add("active_animation"); }, 100);
				hide_timer = setTimeout(function() {
					rooting_space.classList.add("fade_out_message");
					setTimeout(function() {
						rooting_space.classList.remove("active");
						rooting_space.classList.remove("fade_out_message");
					}, 250);
				}, 5000);
	    	}
	    	if (warning_space_u) {
				warning_space_u.classList.remove("active");
			}
	    	if (warning_space_pw) {
				warning_space_pw.classList.remove("active");
			}
			if (warning_space_e) {
				warning_space_e.classList.remove("active");
			}
	    	setTimeout(function() {
	    		/* HTML構造の上書き部分 */
	    		try {
			    	/* 成功したパスワードを保持 */
			    	save_session_storage(password);
			    	console.log("executed 'save_session_storage(<password>);'.");
			    	/* HTML文字列を書き込み */
			    	/* https://developer.mozilla.org/ja/docs/Web/API/Document/write 参照 */
			    	document.open();
			    	document.write(val);
			    	document.close();
			    	console.log("executed 'document.write(<SecretDocument>);'.");
			    	/* オプション処理 */
			    	password_object.value = "";
			    } catch(error) {
			    	if (rooting_space) {
						rooting_space.classList.remove("active");
					}
					if (warning_space_u) {
						warning_space_u.innerHTML = "<span class=\"wss\">不明なエラー</span><br><span class=\"wss\">[" + escape_html(error.name) + "]</span> <span class=\"wss\" style=\"text-align: left;\">" + escape_html(error.message) + "</span></span>";
						warning_space_u.classList.remove("active_animation");
						warning_space_u.classList.add("active");
						setTimeout(function() { warning_space_u.classList.add("active_animation"); }, 100);
					}
					if (warning_space_pw) {
						warning_space_pw.classList.remove("active");
					}
					if (warning_space_e) {
						warning_space_e.classList.remove("active");
					}
					display_body();
					/*console.log("point W1");*/
					throw error;
			    }
		    }, 300);
	  	})
		.catch(function (error) {
			console.log("NG", error.name, error.message);
			/*console.error(error);*/
			if (error.name == "OperationError") {
				if (rooting_space) {
					rooting_space.classList.remove("active");
				}
				if (warning_space_u) {
					warning_space_u.classList.remove("active");
				}
				if (warning_space_pw) {
					warning_space_pw.classList.remove("active_animation");
					warning_space_pw.classList.add("active");
					setTimeout(function() { warning_space_pw.classList.add("active_animation"); }, 100);
					hide_timer = setTimeout(function() {
						warning_space_pw.classList.add("fade_out_message");
						setTimeout(function() {
							warning_space_pw.classList.remove("active");
							warning_space_pw.classList.remove("fade_out_message");
						}, 250);
					}, 5000);
				}
				if (warning_space_e) {
					warning_space_e.classList.remove("active");
				}
			} else {
				if (rooting_space) {
					rooting_space.classList.remove("active");
				}
				if (warning_space_u) {
					warning_space_u.innerHTML = "<span class=\"wss\">不明なエラー</span><br><span class=\"wss\">[" + escape_html(error.name) + "]</span> <span class=\"wss\" style=\"text-align: left;\">" + escape_html(error.message) + "</span></span>";
					warning_space_u.classList.remove("active_animation");
					warning_space_u.classList.add("active");
					setTimeout(function() { warning_space_u.classList.add("active_animation"); }, 100);
				}
				if (warning_space_pw) {
					warning_space_pw.classList.remove("active");
				}
				if (warning_space_e) {
					warning_space_e.classList.remove("active");
				}
			}
			password_object.value = "";
			display_body();
			/*console.log("point W2");*/
			throw error;
		});
	} else {
		if (rooting_space) {
			rooting_space.classList.remove("active");
		}
		if (warning_space_u) {
			warning_space_pw.classList.remove("active");
		}
		if (warning_space_pw) {
			warning_space_pw.classList.remove("active");
		}
		if (warning_space_e) {
			warning_space_e.classList.remove("active_animation");
			warning_space_e.classList.add("active");
			setTimeout(function() { warning_space_e.classList.add("active_animation"); }, 100);
			hide_timer = setTimeout(function() {
				warning_space_e.classList.add("fade_out_message");
				setTimeout(function() {
					warning_space_e.classList.remove("active");
					warning_space_e.classList.remove("fade_out_message");
				}, 250);
			}, 5000);
		}
		display_body();
		/*console.log("point W3");*/
	}
}
